●足裏のザラつきの原因となる角質を、酸とスクラブで除去するリムーバー。<br>●フルーツ酸AHAが、たまった角質をやわらかくし、はがれやすくします。<br>●さらに大粒の天然軽石スクラブが角質をこすりおとし、ガサガサかかとをなめらかに整えます。<br>●ご自宅でのかかとのお手入れに。<BR>※こちらの商品は、お届け地域によって分納・翌日以降のお届けとなる場合がございます。<br>●内容量／75ml<br>●メーカー／ドクター・ショール<br>●型番／257102ﾄﾞｸﾀ<br>●JANコード／4986803804822<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

