ガサガサかかと・ひび割れかかとを、つるんと潤すかかと専用クリーム。保湿性にすぐれた「尿素誘導体」を配合し、かかとのような分厚い角質層にも水分をしっかり取り込みます。クリームは軽く、伸びの良い使用感。すばやく角質層に浸透するため、塗った直後でもかかと表面はさらっとベタつきません。すねやひざなど、かかと以外にも使えます。<BR>※こちらの商品は、お届け地域によって分納・翌日以降のお届けとなる場合がございます。<br>●内容量：70ｇ<br>●メーカー／ドクター・ショール<br>●型番／257103ﾄﾞｸﾀ<br>●JANコード／4986803804884<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

